(9, 5, 'Tampil gaya mengenakan atasan tanpa lengan model simpel.', 'Tampil gaya mengenakan atasan tanpa lengan model simpel. Padankan dengan celana denim dan sepatu hak tinggi untuk tampilan kasual.', 2),
(10, 6, 'Tampil trendi dengan atasan simpel.', 'Tampil trendi dengan atasan simpel. Blus kemeja tanpa lengan berwarna hijau. Padukan atasan ini dengan celana berwarna netral dan sepatu heels untuk menyempurnakan tampilanmu.', 2),
(11, 7, 'Atasan lengan pendek untuk tampilan chic kamu! ', 'Atasan lengan pendek untuk tampilan chic kamu! Memiliki model simpel dengan detail bahan yang nyaman untuk dikenakan. Padankan dengan celana panjang slim fit dan strap heels favoritmu!', 2),
(12, 8, 'dicampur pada sup ataupun kue', 'chia seed merupakan biji yang sangat tinggi omega-3 & serat, hampir semua kandungan karbohidratnya ialah serat, sangat cocok untuk kesehatan pencernaan dan menjaga berat badan normal', 2),
(13, 9, 'MOIAA PREMIX SILKY PUDDING', 'Puding Sehat, Bergizi, Higienis dan selembut Sutra Cemilan penganti Gorengan dan Snack untuk anda dan buah hati tercinta. Teksturnya yang lembut, sekali coba pasti ketagihan.', 2),
(14, 10, 'Ultra Mimi adalah susu untuk tumbuh anak-anak', 'Ultra Mimi adalah susu untuk tumbuh anak-anak dan Ideal untuk tumbuh anak-anak setiap hari minum konsumsi. Produk ini disarankan untuk anak-anak berusia 2 tahun keatas', 2),
(15, 11, 'Exclusive JUMBO Size Tas Tempat Kosmetik Damier / Beautycase / Make up Pouch', 'Tempat kosmetik JUMBO yang akan membantu Anda dalam membawa berbagai peralatan makeup saat bepergian, compartmen yang luas dan model yang cantik.', 2),
(16, 12, 'Kotak Tempat Jam Tangan Sport mix Tempat Perhiasan Brown Croco', 'Kotak Tempat Jam Tangan Sport mix Tempat Perhiasan Brown Croco merupakan kotak penyimpanan jam tangan universal dari diameter jam tangan kecil higga jam tangan berdiameter besar.', 2),
(17, 13, 'Makeup Pouch – Tas Kosmetik Susun Double Compartmen [Purple]', 'Traveller makeup case, sangat praktis untuk menyimpan peralatan makup kamu, desain cantik dan stylist dengan motif branded dan warna polos dengan berbagai pilihan warna cantik.', 2),
